"use strict";function preloadSpotify(){if((new Image).src="/content/images/Sunrise.jpg",!getItemFromStorage("Playtime")){try{fetch("/Spotify/GetIdDurationArtists").then(function(n){return n.json()}).then(function(n){setItemInStorage("Playtime",{hours:n.time});setItemInStorage("Artists",{artists:n.artists})})}catch(n){}try{fetch("/Spotify/GetTracksByYear").then(function(n){return n.json()}).then(function(n){setItemInStorage("TracksByYear",{tracks:n.tracksByYear})})}catch(n){}try{fetch("/Spotify/GetGenres").then(function(n){return n.json()}).then(function(n){setItemInStorage("Genres",{genres:n.genres})})}catch(n){}try{fetch("/Spotify/GetFavorites").then(function(n){return n.json()}).then(function(n){setItemInStorage("Favorites",{favorites:n.favorites})})}catch(n){}}}function handleLocalStorage(){let t=getItemFromStorage("Reset");if(t){var i=new Date,r=new Date(t.date);if(i>r)localStorage.clear();else return}let n=new Date;n.setHours(n.getHours()+3);setItemInStorage("Reset",{date:n})}function setItemInStorage(n,t){localStorage.setItem(n,JSON.stringify(t))}function getItemFromStorage(n){let t=localStorage.getItem(n);return t?JSON.parse(t):null}document.addEventListener("DOMContentLoaded",function(){let n=document.getElementById("info");n.innerHTML="ar@uru.no";handleLocalStorage();setTimeout(function(){preloadSpotify()},2e3)});